// AUDIO SETUP
// starts the audio
async function audio_setup(patcher) {
  // if this is the first time, set up the web audio context and RNBO support:
  if (!window.RNBO) {
    // Create AudioContext
    const WAContext = window.AudioContext || window.webkitAudioContext;
    context = new WAContext();

    // Create gain node and connect it to audio output
    outputNode = context.createGain();
    outputNode.connect(context.destination);
    outputNode.gain.value = 0.5; // default 50% volume

    // Load RNBO script dynamically
    // Note that you can skip this by knowing the RNBO version of your patch beforehand and just include it using a <script> tag
    await loadRNBOScript(patcher.desc?.meta?.rnboversion || "1.0.0");
    console.log("loaded RNBO");
  }

  // Removes any current device
  if (patcherNode != null) {
    patcherNode.node.disconnect(outputNode);
  }

  // Creates the new device
  try {
    patcherNode = await RNBO.createDevice({ context, patcher });
  } catch (err) {
    // TODO: display an error on the webpage
    console.error(err);
    return;
  }

  // Connect the patcher to the web audio outputs:
  patcherNode.node.connect(outputNode);

  // start sound
  context.resume();
}

// UPDATE PARAMETERS
function update_parameters(json, node) {
  if (node) {
    // update audio parameters:
    // this connects the live weather data to the synth parameters in the RNBO patch
    node.parameters.forEach((param) => {
      // Extracts the parameter name after the last /
      const paramName = param.name.split("/").pop().toLowerCase();
      // I had to use this style to get my patcher to work correctly because when I loaded it in the order of parameters and names were slightly different.
      if (paramName.includes("lon") && !paramName.includes("lat")) {
        param.value = json.coord.lon;
      } else if (paramName.includes("lat")) {
        param.value = json.coord.lat;
      } else if (paramName.includes("feels")) {
        param.value = json.main.feels_like;
      } else if (paramName === "temp") {
        param.value = json.main.temp;
      } else if (paramName.includes("pressure")) {
        param.value = json.main.pressure;
      } else if (paramName.includes("humidity")) {
        param.value = json.main.humidity;
      } else if (paramName.includes("cloud")) {
        param.value = json.clouds.all;
      } else if (paramName.includes("visibility")) {
        param.value = json.visibility;
      } else if (paramName.includes("wind_speed")) {
        param.value = json.wind.speed;
      } else if (paramName.includes("wind_deg")) {
        param.value = json.wind.deg;
      } else if (paramName.includes("wind_gust")) {
        param.value = json.wind.gust || 0;
      } else if (paramName.includes("sea_level")) {
        param.value = json.main.sea_level;
      } else if (paramName.includes("grnd_level")) {
        param.value = json.main.grnd_level;
      } else if (paramName.includes("weather_id")) {
        param.value = json.weather[0].id;
      } else if (paramName.includes("sunrise")) {
        param.value = json.sys.sunrise;
      } else if (paramName.includes("sunset")) {
        param.value = json.sys.sunset;
      } else if (paramName === "dt") {
        param.value = json.dt;
      }
    });
  }
}

//RNBO SCRIPT
function loadRNBOScript(version) {
  return new Promise((resolve, reject) => {
    if (/^\d+\.\d+\.\d+-dev$/.test(version)) {
      throw new Error(
        "Patcher exported with a Debug Version!\nPlease specify the correct RNBO version to use in the code."
      );
    }
    const el = document.createElement("script");
    el.src =
      "https://c74-public.nyc3.digitaloceanspaces.com/rnbo/" +
      encodeURIComponent(version) +
      "/rnbo.min.js";
    el.onload = resolve;
    el.onerror = function (err) {
      console.log(err);
      reject(new Error("Failed to load rnbo.js v" + version));
    };
    document.body.append(el);
  });
}

// FETCH WEATHER DATA
async function getData() {
  // starts the audio if not started yet
  if (!patcherNode) {
    await audio_setup(patcher);
  }
  let lat = parseFloat(document.getElementById("lat").value);
  let lon = parseFloat(document.getElementById("lon").value);

  // validate inputs, error handling
  if (isNaN(lat) || isNaN(lon)) {
    alert(
      "Please enter valid numbers for latitude and longitude or select a city"
    );
    return;
  }

  if (lat < -90 || lat > 90 || lon < -180 || lon > 180) {
    //checks if value is outside of range
    alert(
      "Latitude must be between -90 and 90, Longitude must be between -180 and 180"
    );
    return;
  }

  let key = "7aa553c6a465f01ce2bf1ea46d98c4b0";
  let url =
    "https://api.openweathermap.org/data/2.5/weather?lat=" +
    lat +
    "&lon=" +
    lon +
    "&appid=" +
    key;

  try {
    // fetch weather data from the OpenWeather API
    const response = await fetch(url);
    if (!response.ok) {
      throw new Error(`Response status: ${response.status}`);
    }
    weather_data = await response.json();
    console.log(weather_data);

    // update synth parameters with new weather data
    update_parameters(weather_data, patcherNode);
    document.getElementById("local_time").textContent =
      "Local Time: " + convertLocalTime(weather_data.dt, weather_data.timezone);
    updateVisuals(weather_data);
  } catch (error) {
    console.error(error.message);
  }
}

