// VISUALS section of code
let canvas, ctx, particles, bgColor, sunPosition, brightness, weatherCondition; //initialize

function updateVisuals(data) {
  if (!canvas || !ctx) return;

  let currentTime = data.dt;
  let sunrise = data.sys.sunrise;
  let sunset = data.sys.sunset;
  sunPosition = (currentTime - sunrise) / (sunset - sunrise);

  // time of day color gradients
  if (sunPosition < 0) {
    // night 1
    bgColor = { r: 10, g: 15, b: 45 };
  } else if (sunPosition > 1) {
    // night 2
    bgColor = { r: 10, g: 15, b: 45 };
  } else if (sunPosition < 0.05) {
    // morning 1
    bgColor = { r: 25, g: 35, b: 70 };
  } else if (sunPosition < 0.15) {
    // morning 2
    bgColor = { r: 200, g: 100, b: 150 };
  } else if (sunPosition < 0.25) {
    // morning 3
    bgColor = { r: 255, g: 180, b: 120 };
  } else if (sunPosition < 0.4) {
    // morning 4
    bgColor = { r: 150, g: 200, b: 240 };
  } else if (sunPosition < 0.6) {
    // afternoon 1
    bgColor = { r: 135, g: 206, b: 250 };
  } else if (sunPosition < 0.75) {
    // afternoon 2
    bgColor = { r: 150, g: 200, b: 240 };
  } else if (sunPosition < 0.85) {
    // afternoon 3
    bgColor = { r: 255, g: 180, b: 120 };
  } else if (sunPosition < 0.95) {
    // evening 1
    bgColor = { r: 220, g: 120, b: 160 };
  } else {
    // evening 2
    bgColor = { r: 40, g: 50, b: 90 };
  }

  // brightness based on clouds
  brightness = 1 - (data.clouds.all / 100) * 0.6;

  // Weather ID ranges
  let weatherId = data.weather[0].id;
  if (weatherId >= 200 && weatherId <= 232) {
    weatherCondition = "thunder";
  } else if (weatherId >= 300 && weatherId <= 321) {
    weatherCondition = "drizzle";
  } else if (weatherId >= 500 && weatherId <= 531) {
    weatherCondition = "rain";
  } else if (weatherId >= 600 && weatherId <= 622) {
    weatherCondition = "snow";
  } else if (weatherId >= 700 && weatherId <= 781) {
    weatherCondition = "atmosphere";
  } else if (weatherId >= 800 && weatherId <= 804) {
    weatherCondition = "clouds";
  } else {
    weatherCondition = "clear";
  }

  // wind creates particles
  let windSpeed = data.wind.speed;
  let windDeg = data.wind.deg || 0;
  window.currentWindSpeed = windSpeed;
  window.currentWindDeg = windDeg;
  let particleCount =
    weatherCondition === "drizzle"
      ? Math.floor(windSpeed * 5)
      : Math.floor(windSpeed * 10);
  particles = [];
  for (let i = 0; i < particleCount; i++) {
    particles.push(new Particle());
  }
  // Changes the text color based on background brightness
  let avgBrightness = ((bgColor.r + bgColor.g + bgColor.b) / 3) * brightness;
  if (avgBrightness < 100) {
    document.body.style.color = "white";
    const controls = document.querySelector(".controls");
    if (controls) controls.style.background = "rgba(0, 0, 0, 0.6)";
  } else {
    document.body.style.color = "black";
    const controls = document.querySelector(".controls");
    if (controls) controls.style.background = "rgba(255, 255, 255, 0.8)";
  }

  // Stores humidity and visibility globally
  window.currentHumidity = data.main.humidity;
  window.currentVisibility = data.visibility;
}

window.addEventListener("DOMContentLoaded", () => {
  //creates canvas for drawing with dimensions of the whole screen
  canvas = document.getElementById("weather-canvas");
  ctx = canvas.getContext("2d");
  canvas.width = window.innerWidth;
  canvas.height = window.innerHeight;

  particles = []; //creates array to store moving particles
  bgColor = { r: 135, g: 206, b: 235 }; //default bg color
  sunPosition = 0; //default sun position
  brightness = 1;
  weatherCondition = "clear"; //default weather condition

  // Initialize stars
  for (let i = 0; i < 100; i++) {
    //draws 100 stars
    stars.push({
      x: Math.random() * canvas.width,
      y: Math.random() * canvas.height * 0.3,
      size: Math.random() * 2,
      twinkle: Math.random(),
      twinkleSpeed: 0.02 + Math.random() * 0.06, //random speed for random twinkle/sparkles
    });
  }

  class Particle {
    //class for defining different particles
    constructor() {
      this.x = Math.random() * canvas.width; //randomize position on x axis
      this.y = Math.random() * canvas.height; //randomize position on y axis

      let windSpeed = window.currentWindSpeed || 2; //default is 2
      let windDeg = window.currentWindDeg || 0; //default is 0

      if (weatherCondition === "snow") {
        this.speed = 2 + windSpeed * 0.5;
        this.size = 4;
      } else if (weatherCondition === "drizzle") {
        this.speed = 2.5 + windSpeed * 0.6; // Slower than rain
        this.size = 1.5; // Smaller than rain
      } else if (weatherCondition === "rain") {
        this.speed = 3 + windSpeed * 0.6;
        this.size = 2;
      } else {
        this.speed = windSpeed;
        this.size = 1.5;
        // velocity based on wind direction
        let radians = (windDeg * Math.PI) / 180;
        this.vx = Math.sin(radians) * this.speed;
        this.vy = -Math.cos(radians) * this.speed;
      }
    }

    update() {
      if (weatherCondition === "rain" || weatherCondition === "drizzle") {
        this.y += this.speed * (weatherCondition === "drizzle" ? 3 : 4);
        if (this.y > canvas.height) this.y = 0;
      } else if (weatherCondition === "snow") {
        this.y += this.speed;
        if (this.y > canvas.height) this.y = 0;
      } else {
        // Wind particles move based on direction
        this.x += this.vx;
        this.y += this.vy;
        // Wrap around screen
        if (this.x > canvas.width) this.x = 0;
        if (this.x < 0) this.x = canvas.width;
        if (this.y > canvas.height) this.y = 0;
        if (this.y < 0) this.y = canvas.height;
      }
    }

    draw() {
      let visibility = window.currentVisibility || 10000;
      let fadeDistance = (visibility / 10000) * canvas.height; //the level visibility controls how particles fade into background
      let distanceFromTop = this.y / canvas.height;
      let alpha =
        visibility < 5000
          ? Math.max(0.2, 1 - distanceFromTop * (1 - visibility / 5000))
          : 1;
      if (weatherCondition === "snow") {
        ctx.fillStyle = "white";
        ctx.beginPath();
        ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
        ctx.fill();
      } else {
        ctx.fillStyle = "rgba(200, 200, 255, 0.6)";
        ctx.fillRect(
          this.x,
          this.y,
          this.size,
          weatherCondition === "rain" || weatherCondition === "drizzle"
            ? this.size * 4
            : this.size
        );
      }
    }
  }

  window.Particle = Particle;

  function animate() {
    //realistic background gradient
    let gradient = ctx.createLinearGradient(0, 0, 0, canvas.height);

    // drawing th esun during different stages of day
    if (sunPosition < 0 || sunPosition > 1) {
      //nightime
      gradient.addColorStop(
        0,
        `rgb(${10 * brightness}, ${15 * brightness}, ${45 * brightness})`
      );
      gradient.addColorStop(
        0.5,
        `rgb(${5 * brightness}, ${10 * brightness}, ${30 * brightness})`
      );
      gradient.addColorStop(
        1,
        `rgb(${0 * brightness}, ${5 * brightness}, ${15 * brightness})`
      );
    } else if (sunPosition < 0.05) {
      // early in morning
      gradient.addColorStop(
        0,
        `rgb(${25 * brightness}, ${35 * brightness}, ${70 * brightness})`
      );
      gradient.addColorStop(
        0.6,
        `rgb(${15 * brightness}, ${25 * brightness}, ${50 * brightness})`
      );
      gradient.addColorStop(
        1,
        `rgb(${30 * brightness}, ${40 * brightness}, ${60 * brightness})`
      );
    } else if (sunPosition < 0.15) {
      // morning  2
      gradient.addColorStop(
        0,
        `rgb(${100 * brightness}, ${60 * brightness}, ${150 * brightness})`
      );
      gradient.addColorStop(
        0.4,
        `rgb(${200 * brightness}, ${100 * brightness}, ${150 * brightness})`
      );
      gradient.addColorStop(
        0.7,
        `rgb(${255 * brightness}, ${150 * brightness}, ${100 * brightness})`
      );
      gradient.addColorStop(
        1,
        `rgb(${255 * brightness}, ${180 * brightness}, ${120 * brightness})`
      );
    } else if (sunPosition < 0.25) {
      // morning 3
      gradient.addColorStop(
        0,
        `rgb(${150 * brightness}, ${200 * brightness}, ${240 * brightness})`
      );
      gradient.addColorStop(
        0.3,
        `rgb(${200 * brightness}, ${220 * brightness}, ${245 * brightness})`
      );
      gradient.addColorStop(
        0.7,
        `rgb(${255 * brightness}, ${200 * brightness}, ${150 * brightness})`
      );
      gradient.addColorStop(
        1,
        `rgb(${255 * brightness}, ${180 * brightness}, ${120 * brightness})`
      );
    } else if (sunPosition < 0.4) {
      // morning 4
      gradient.addColorStop(
        0,
        `rgb(${100 * brightness}, ${150 * brightness}, ${220 * brightness})`
      );
      gradient.addColorStop(
        0.5,
        `rgb(${135 * brightness}, ${206 * brightness}, ${250 * brightness})`
      );
      gradient.addColorStop(
        1,
        `rgb(${180 * brightness}, ${220 * brightness}, ${255 * brightness})`
      );
    } else if (sunPosition < 0.6) {
      // afternoon
      gradient.addColorStop(
        0,
        `rgb(${70 * brightness}, ${130 * brightness}, ${220 * brightness})`
      );
      gradient.addColorStop(
        0.5,
        `rgb(${100 * brightness}, ${180 * brightness}, ${255 * brightness})`
      );
      gradient.addColorStop(
        1,
        `rgb(${150 * brightness}, ${210 * brightness}, ${255 * brightness})`
      );
    } else if (sunPosition < 0.75) {
      //  afternoon 2
      gradient.addColorStop(
        0,
        `rgb(${100 * brightness}, ${150 * brightness}, ${220 * brightness})`
      );
      gradient.addColorStop(
        0.5,
        `rgb(${135 * brightness}, ${206 * brightness}, ${250 * brightness})`
      );
      gradient.addColorStop(
        1,
        `rgb(${180 * brightness}, ${220 * brightness}, ${255 * brightness})`
      );
    } else if (sunPosition < 0.85) {
      //  afternoon 3
      gradient.addColorStop(
        0,
        `rgb(${150 * brightness}, ${200 * brightness}, ${240 * brightness})`
      );
      gradient.addColorStop(
        0.5,
        `rgb(${255 * brightness}, ${200 * brightness}, ${150 * brightness})`
      );
      gradient.addColorStop(
        1,
        `rgb(${255 * brightness}, ${160 * brightness}, ${100 * brightness})`
      );
    } else if (sunPosition < 0.95) {
      // evening
      gradient.addColorStop(
        0,
        `rgb(${80 * brightness}, ${50 * brightness}, ${120 * brightness})`
      );
      gradient.addColorStop(
        0.3,
        `rgb(${150 * brightness}, ${80 * brightness}, ${150 * brightness})`
      );
      gradient.addColorStop(
        0.6,
        `rgb(${220 * brightness}, ${120 * brightness}, ${160 * brightness})`
      );
      gradient.addColorStop(
        1,
        `rgb(${255 * brightness}, ${140 * brightness}, ${100 * brightness})`
      );
    } else {
      // Evening 2
      gradient.addColorStop(
        0,
        `rgb(${40 * brightness}, ${50 * brightness}, ${90 * brightness})`
      );
      gradient.addColorStop(
        0.6,
        `rgb(${25 * brightness}, ${35 * brightness}, ${60 * brightness})`
      );
      gradient.addColorStop(
        1,
        `rgb(${15 * brightness}, ${20 * brightness}, ${40 * brightness})`
      );
    }

    ctx.fillStyle = gradient;
    ctx.fillRect(0, 0, canvas.width, canvas.height);

    // Sun in its arc path
    if (sunPosition >= 0 && sunPosition <= 1) {
      let arcAngle = Math.PI * sunPosition;
      let sunX = canvas.width * 0.2 + canvas.width * 0.6 * sunPosition;
      let sunY = canvas.height - Math.sin(arcAngle) * canvas.height * 0.6;

      // outside glow
      let outerGlow = ctx.createRadialGradient(sunX, sunY, 0, sunX, sunY, 100);
      outerGlow.addColorStop(0, `rgba(255, 255, 200, ${0.3 * brightness})`);
      outerGlow.addColorStop(0.5, `rgba(255, 240, 150, ${0.15 * brightness})`);
      outerGlow.addColorStop(1, `rgba(255, 200, 100, 0)`);
      ctx.fillStyle = outerGlow;
      ctx.beginPath();
      ctx.arc(sunX, sunY, 100, 0, Math.PI * 2);
      ctx.fill();

      //mid glow
      let middleGlow = ctx.createRadialGradient(sunX, sunY, 0, sunX, sunY, 70);
      middleGlow.addColorStop(0, `rgba(255, 255, 220, ${0.6 * brightness})`);
      middleGlow.addColorStop(0.7, `rgba(255, 230, 150, ${0.3 * brightness})`);
      middleGlow.addColorStop(1, `rgba(255, 200, 100, 0)`);
      ctx.fillStyle = middleGlow;
      ctx.beginPath();
      ctx.arc(sunX, sunY, 70, 0, Math.PI * 2);
      ctx.fill();

      //core of sun
      let sunGradient = ctx.createRadialGradient(sunX, sunY, 0, sunX, sunY, 50);
      sunGradient.addColorStop(0, `rgba(255, 255, 240, ${brightness})`);
      sunGradient.addColorStop(0.4, `rgba(255, 240, 180, ${brightness})`);
      sunGradient.addColorStop(0.7, `rgba(255, 220, 120, ${brightness})`);
      sunGradient.addColorStop(1, `rgba(255, 200, 80, ${brightness})`);
      ctx.fillStyle = sunGradient;
      ctx.beginPath();
      ctx.arc(sunX, sunY, 50, 0, Math.PI * 2);
      ctx.fill();
    }

    // Draw stars at night only if clear and very few clouds
    if (
      (sunPosition < 0 || sunPosition > 1) &&
      (weatherCondition === "clear" || weatherCondition === "clouds") &&
      window.currentHumidity < 70
    ) {
      stars.forEach((star) => {
        star.twinkle += star.twinkleSpeed; // use individual speed
        let alpha = ((Math.sin(star.twinkle) + 1) / 2) * 0.8 + 0.2;
        ctx.fillStyle = `rgba(255, 255, 255, ${alpha * brightness})`;
        ctx.beginPath();
        ctx.arc(star.x, star.y, star.size, 0, Math.PI * 2);
        ctx.fill();
      });
    }

    // Humidity droplets on edges
    let humidity = window.currentHumidity || 0;
    if (humidity > 30) {
      // creates extra droplets if humidity is high
      let targetDroplets = Math.floor((humidity - 30) / 3); //# of humidity drops
      while (humidityDroplets.length < targetDroplets) {
        let edge = Math.floor(Math.random() * 4);
        let droplet = { size: Math.random() * 2 + 1.5 }; // drop size

        if (edge === 0) {
          //Top
          droplet.x = Math.random() * canvas.width;
          droplet.y = Math.random() * 30; //distance from edge
        } else if (edge === 1) {
          // right
          droplet.x = canvas.width - Math.random() * 30; //distance from edge
          droplet.y = Math.random() * canvas.height;
        } else if (edge === 2) {
          //bottom
          droplet.x = Math.random() * canvas.width;
          droplet.y = canvas.height - Math.random() * 30; //distance from edge
        } else {
          // left
          droplet.x = Math.random() * 30; //distance from edge
          droplet.y = Math.random() * canvas.height;
        }
        humidityDroplets.push(droplet);
      }

      // Draw droplets
      ctx.fillStyle = "rgba(150, 180, 255, 0.25)"; //color and opacity of humidity droplets
      humidityDroplets.forEach((d) => {
        ctx.beginPath();
        ctx.arc(d.x, d.y, d.size, 0, Math.PI * 2);
        ctx.fill();
      });
    } else {
      humidityDroplets = [];
    }

    // Visibility blur overlay
    let visibility = window.currentVisibility || 10000;
    let fogOpacity =
      visibility === 0 ? 0.95 : Math.max(0, (10000 - visibility) / 10000);
    if (fogOpacity > 0.1) {
      ctx.fillStyle = `rgba(160, 160, 160, ${fogOpacity})`;
      ctx.fillRect(0, 0, canvas.width, canvas.height);
    }

    particles.forEach((p) => {
      p.update();
      p.draw();
    });

    // Lightning for thunderstorms
    if (weatherCondition === "thunder") {
      // Random chance for lightning strike
      if (Math.random() < 0.015) {
        // Draw lightning bolt
        let startX = Math.random() * canvas.width;
        let startY = 0;
        let segments = 8 + Math.floor(Math.random() * 5); // 8-12 lines

        ctx.strokeStyle = "rgba(255, 255, 255, 0.9)";
        ctx.lineWidth = 3;
        ctx.shadowBlur = 20;
        ctx.shadowColor = "white";

        ctx.beginPath();
        ctx.moveTo(startX, startY);

        let currentX = startX;
        let currentY = startY;

        for (let i = 0; i < segments; i++) {
          currentX += (Math.random() - 0.5) * 60; // zigzag on x axis
          currentY += canvas.height / segments;
          ctx.lineTo(currentX, currentY);

          // Random branchs
          if (Math.random() < 0.3) {
            let branchX = currentX + (Math.random() - 0.5) * 100;
            let branchY = currentY + Math.random() * 50;
            ctx.lineTo(branchX, branchY);
            ctx.moveTo(currentX, currentY);
          }
        }

        ctx.stroke();
        ctx.shadowBlur = 0;

        // screen flashes
        ctx.fillStyle = "rgba(255, 255, 255, 0.3)";
        ctx.fillRect(0, 0, canvas.width, canvas.height);
      }
    }

    requestAnimationFrame(animate);
  }

  animate();
  updateVisuals(weather_data);
});

